import React from 'react';
import { Button } from '../../Components/Buttons';
import { Card } from '../../Components/Cards';
import { Container, Item } from '../../Components/Grid';
import { ThemeContext } from '../../Contexts';

const Main = () => {
	const themeContext = React.useContext(ThemeContext);

	return (
		<React.Fragment>
			<Container
				direction={'row'}
				wrap={'no-wrap'}
				justifyContent={'center'}
				alignItems={'center'}
				spacing={2}
			>
				<Item size={8}>
					<Card
						backgroundColor={themeContext?.palette?.white}
						boxShadow={themeContext?.cssProperties?.boxShadow?.light}
					>
						<div style={{ height: '400px' }} />
					</Card>
				</Item>
				<Item size={8}>
					<Card
						backgroundColor={themeContext?.palette?.white}
						boxShadow={themeContext?.cssProperties?.boxShadow?.light}
					>
						<div style={{ height: '400px' }} />
					</Card>
				</Item>
			</Container>
		</React.Fragment>
	);
};

export default Main;
